import Photo from './Components/Photo';
// import NoResults from './Components/NoResults';

const App = () => {
  return (
    <div className="container">
      {/* <Nav /> */}
      <Search />
      <Gallery> 
        <Photo />
        {/* <NoResults /> */}
      </Gallery>
    </div>
  )
};

export default App;
